import Adopt from "./components/Adopt/Adopt.js";
import Banner from "./components/Banner/Banner.js";
import Nav from "./components/Nav/Nav.js";


function App() {
  return (
    <div>
      <Banner/>
      <Adopt/>
    <Nav/>
    <></></div>
  );
}

export default App;
